import React from "react";

function Navigation() {
  return (
    <nav>
      <ul className="nav">
        <li>
          <a href="#about">About Me</a>
        </li>
        <li>
          <a href="#work">Portfolio</a>
        </li>
        <li>
          <a href="#contact">Contact</a>
        </li>
        <li>
          <a href="#resume">Resume</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
